import { Container }  from '@mui/material';
import { Link } from 'react-router-dom';
import User from './User';
export default class Main extends Component {
  constructor(props) {
    super(props);
    var user=User.userSearch(1)
    var userName=JSON.parse(user, (key, value) => {
      if (key === 'name') {
        return value;
      }
      return value;
    });
    this.state = {
      name: userName,
      email: '',
      id: '',
    };

     console.log(user)
  }

  render() {
    return (
      <Container>
        <div>
          <h2>Hello Login app mypage</h2>
          <p>名前{this.state.name}</p>
          <div>
            <Link to="/logout">Logout</Link>
          </div>
        </div>
      </Container>
    );
  }
}
